import React from 'react';
import { useNavigate } from 'react-router-dom'
import './Navbar.css';   

const Navbar = (props) => {
    const navigate = useNavigate(); 

    const handleSignInRedirect = () => {
        if (!props.loggedIn) {
            navigate('/sign-in'); // Navigate to Sign In page if not logged in
        }
    };

    return (
        <nav className='navbar'>
            <ul className='nav-links'>
                <li>
                    <a href='/' onClick={(e) => { e.preventDefault(); navigate('/'); }}>Home</a>
                </li>
                <li>
                    {props.loggedIn === true ? (
                        <a href='/create-event'>Create an Event</a>
                    ) : (
                        <a href='/sign-in' onClick={(e) => { e.preventDefault(); handleSignInRedirect(); }}>Create an Event</a>
                    )}
                </li>
                <li>
                    {props.loggedIn === true ? (
                        <a href='/profile'>Profile</a>
                    ) : (
                        <a href='/sign-in' onClick={(e) => { e.preventDefault(); handleSignInRedirect(); }}>Profile</a>
                    )}
                </li>
            </ul>
        </nav>
    );
}
export default Navbar;
